sourcesContent:
import styled from 'styled-components';

export const DashboardHead = styled.div`
  text-align: center;
  align-items: center;
  margin: auto;
  background-color = green;
`
export const popup = style.div
`
  border: 2px solid black;
  z-index: 2;
  position: fixed;
  background-color: white;
  text-align: center;
  left: 0;
  bottom: 0;
`
